package com.fetchupload.data;

import java.util.Base64;
import java.util.regex.Matcher;
import java.util.regex.Pattern;

public class MainDemo {

	public static final String[] accepted_file_extn = new String[] { "zip", "pdf", "docx", "doc", "tiff" };

	public static Base64ReturnObject base64StringCheck(String base64_input, String mime_type) {
		String status = null;
		Base64ReturnObject bs_returnObject = new Base64ReturnObject();
		System.out.println(
				"OSB Java Callout classname base64StringCheck =========base64_input received=======" + base64_input);
		if (base64_input != null && !base64_input.trim().equals("")) {
			Pattern pattern = Pattern.compile("^([A-Za-z0-9+/]{4})*([A-Za-z0-9+/]{3}=|[A-Za-z0-9+/]{2}==)?$");
			Matcher m = pattern.matcher(base64_input);
			boolean flag = false;
			while (m.find())
				flag = true;
			if (flag) {
				Base64ReturnObject bs_returnObject_1 = decodeBase64String(base64_input, mime_type);
				return bs_returnObject_1;
			}
			bs_returnObject.setStatus("base64 input is invalid");
			bs_returnObject.setError_message("ERROR OCCURRED");
			return bs_returnObject;
		}
		bs_returnObject.setStatus("Faliure .Received 0 byte file from the user");
		bs_returnObject.setError_message("ERROR OCCURRED");
		return bs_returnObject;
	}

	public static Base64ReturnObject decodeBase64String(String originalInput, String mime_type) {
		Base64ReturnObject bs_returnObject = new Base64ReturnObject();
		String decodedString = null;
		Base64.Decoder decoder = Base64.getMimeDecoder();
		try {
			decodedString = new String(decoder.decode(originalInput.getBytes()));
			System.out.println("decodedString ====" + decodedString);
			byte b;
			int i;
			String[] arrayOfString;
			for (i = (arrayOfString = accepted_file_extn).length, b = 0; b < i;) {
				String extn = arrayOfString[b];
				if (decodedString.toLowerCase().contains(extn)) {
					System.out.println("mime_type::" + mime_type + "extn===" + extn);
					if (mime_type != null && extn != null && !extn.contains(mime_type.toLowerCase())) {
						bs_returnObject.setStatus("Mismatch of extensions.Expected mime type received = " + mime_type
								+ ".However got mime type as =" + extn);
						bs_returnObject.setError_message("ERROR OCCURRED");
						return bs_returnObject;
					}
					System.out.println("The file is valid with extn ===" + extn);
					bs_returnObject.setStatus("The file is valid with extn = " + extn);
					bs_returnObject.setError_message("NO ERROR");
					return bs_returnObject;
				}
				b++;
			}
		} catch (Exception e) {
			bs_returnObject.setStatus("MALFORMED BASE64 received");
			bs_returnObject.setError_message("EXCEPTION OCCURRED");
			return bs_returnObject;
		}
		bs_returnObject.setStatus("No binary content of any valid type");
		bs_returnObject.setError_message("ERROR_OCCURRED");
		return bs_returnObject;
	}

	public static void main(String[] args) {
//		String originalInput = "";
		String originalInput = "";
		String string="";
		Base64ReturnObject bs_returnObject = new Base64ReturnObject();
		bs_returnObject = base64StringCheck(originalInput, "pdf");
		System.out.println("res===" + bs_returnObject.status);
	}
}
